INSERT INTO `church_home` VALUES (1,'published',1,'2019-09-16 20:30:15',1,'2019-11-02 20:58:03','WELS Church in Kitsap County','Lutheran church serving Kitsap County Christ the King Lutheran Chuch & School.','Lutheran Church Serving Kitsap County',NULL,'<h2>Our Mission</h2><p>Christâ€™s love compels and the Holy Spirit empowers Christ the King Evangelical Lutheran Church to glorify God as we preach and teach the inerrant Holy Scriptures and administer Godâ€™s sacraments. Therefore, our mission is to grow in Godâ€™s Word, to gather around His Word with fellow Christians, and to go into our community and the world with the good news of eternal life through faith in Jesus Christ.</p><p>Christ the King Evangelical Lutheran Church strives to be a Christ-centered family committed to Godâ€™s true Word as we faithfully learn, worship, serve, and care for one another, sharing the love of Christ in a spirit of praise and joy within our church and community.</p><h2>What you can expect</h2><p>Worship is central to our mission of faithfully proclaiming Godâ€™s Word and administering the Sacraments. The message of salvation through Jesus Christ is for everyone.</p><p>We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.</p>');
