INSERT INTO `church_news` VALUES (1,'published',1,'2019-09-16 22:19:15',1,'2019-09-25 21:53:33','CtK School Promo Video',11,'2017-11-03','<p>Content for the promo video<br></p>','1','ctk-school-promo-video'),(2,'published',1,'2019-09-16 22:20:37',1,'2019-09-25 21:54:01','Summer Soccer Camps',12,'2019-09-12','<h2>Join us for our 2019 kidsâ€™ summer soccer camps!</h2><p>We will open with a devotion, go to skills stations to learn some basic skills from our high school level instructors, take a snack break, and then play a scrimmage. There will be plenty of time for participants to learn that their gifts come from the Lord â€“ in sports and everything else in life! Invite friends and cousins to come play soccer with us!</p><h3>Preschool (4-year-olds) and Kindergarten: June 4-6 from 6:00-7:00pm.</h3><p>Registration costs $35 per child.</p><h3>1st-4th Grade: June 11-13 from 6:00-7:30pm.</h3><p>Registration costs $40 per child.</p><p>Each child who registers will get:</p><ul><li>A soccer camp t-shirt</li><li>Reusable water bottle</li><li>Soccer ball</li></ul><p>Register your child today!</p>','1','summer-soccer-camps'),(3,'published',1,'2019-09-16 22:21:34',1,'2019-09-25 21:55:17','Some other content',14,'2019-09-17','<p>something</p>','1','some-other-content'),(4,'published',1,'2019-09-26 20:36:34',1,'2019-09-26 20:36:34','Another Item',14,'2019-09-25','<p>Content</p><p><br></p><p>Stuff<br></p>',NULL,'another-item');
