INSERT INTO `church_pages` VALUES (1,'deleted',NULL,1,'2019-09-16 21:20:22',1,'2019-11-02 20:59:12','What to expect','Worship is central to our mission of faithfully proclaiming Godâ€™s Word and administering the Sacraments.','Christ\'s Love, Our Community','What to expect when you visit','<h3>Worship is central to our mission of faithfully proclaiming Godâ€™s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.</h3><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.</p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.</p>',NULL,NULL,'what-to-expect');
