\",\"group\":null,\"note\":\"Text in Google search\",\"translation\":null}','{\"sort\":9,\"type\":\"string\",\"interface\":\"textarea\",\"options\":{\"rows\":12},\"readonly\":false,\"required\":false,\"note\":\"Text in Google search\",\"hidden_detail\":false,\"hidden_browse\":false,\"validation\":null,\"width\":\"full\"}',NULL,NULL,NULL),(357,938,'church_home','1','{\"id\":\"1\",\"status\":\"draft\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 20:30:15\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-16 21:16:45\",\"meta_title\":\"WELS Church in Kitsap County\",\"meta_description\":\"Lutheran church serving Kitsap County Christ the King Lutheran Chuch & School.\",\"page_title\":\"Lutheran Church Serving Kitsap County\",\"page_subtitle\":null,\"introduction\":\"<h2>Our Mission<\\/h2><p>Christ\\u2019s love compels and the Holy Spirit empowers Christ the King Evangelical Lutheran Church to glorify God as we preach and teach the inerrant Holy Scriptures and administer God\\u2019s sacraments. Therefore, our mission is to grow in God\\u2019s Word, to gather around His Word with fellow Christians, and to go into our community and the world with the good news of eternal life through faith in Jesus Christ.<\\/p><p>Christ the King Evangelical Lutheran Church strives to be a Christ-centered family committed to God\\u2019s true Word as we faithfully learn, worship, serve, and care for one another, sharing the love of Christ in a spirit of praise and joy within our church and community.<\\/p>\"}','{\"page_title\":\"Lutheran Church Serving Kitsap County\",\"meta_description\":\"Lutheran church serving Kitsap County Christ the King Lutheran Chuch & School.\",\"meta_title\":\"WELS Church in Kitsap County\",\"introduction\":\"<h2>Our Mission<\\/h2><p>Christ\\u2019s love compels and the Holy Spirit empowers Christ the King Evangelical Lutheran Church to glorify God as we preach and teach the inerrant Holy Scriptures and administer God\\u2019s sacraments. Therefore, our mission is to grow in God\\u2019s Word, to gather around His Word with fellow Christians, and to go into our community and the world with the good news of eternal life through faith in Jesus Christ.<\\/p><p>Christ the King Evangelical Lutheran Church strives to be a Christ-centered family committed to God\\u2019s true Word as we faithfully learn, worship, serve, and care for one another, sharing the love of Christ in a spirit of praise and joy within our church and community.<\\/p>\"}',NULL,NULL,NULL),(358,939,'church_pages','1','{\"id\":\"1\",\"status\":\"draft\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:20:22\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-16 21:20:22\",\"meta_title\":null,\"meta_description\":null,\"page_title\":null,\"page_subtitle\":null,\"content\":\"<p>What you can expect<\\/p><p>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/p><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\",\"primary_image\":null}','{\"status\":\"draft\",\"content\":\"<p>What you can expect<\\/p><p>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/p><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children 