milies. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\",\"status\":\"published\",\"meta_title\":\"What to expect\",\"page_title\":\"Christ\'s Love, Our Community\",\"page_subtitle\":\"What to expect when you visit\",\"meta_description\":\"Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments.\"}',NULL,NULL,NULL),(360,941,'home_page','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-14 18:45:32\",\"page_title\":\"Lutheran Church Serving Kitsap County\",\"page_subtitle\":\"This is a subtitle\",\"meta_title\":\"Lutheran Church Serving Kitsap County\",\"meta_description\":null}','{\"meta_title\":\"Lutheran Church Serving Kitsap County\"}',NULL,NULL,NULL),(361,942,'school_home','1','{\"id\":\"1\",\"status\":\"draft\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 20:30:08\",\"meta_title\":\"Title\",\"meta_description\":null,\"page_title\":\"Christian Education in Kitsap County\",\"page_subtitle\":null,\"introduction\":\"<p>Welcome to Christ the King Lutheran School. We\\u2019re glad you have come to our website to learn more about the great school God has given to us. Please look through the information below to learn more about CtK. If you have any questions, please don\\u2019t hesitate to give us a call or stop by for a visit.<\\/p>\",\"curriculum\":null}','{\"introduction\":\"<p>Welcome to Christ the King Lutheran School. We\\u2019re glad you have come to our website to learn more about the great school God has given to us. Please look through the information below to learn more about CtK. If you have any questions, please don\\u2019t hesitate to give us a call or stop by for a visit.<\\/p>\",\"page_title\":\"Christian Education in Kitsap County\"}',NULL,NULL,NULL),(362,943,'school_home','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 20:30:08\",\"meta_title\":\"Christian Education in Kitsap County\",\"meta_description\":null,\"page_title\":\"Christian Education in Kitsap County\",\"page_subtitle\":null,\"introduction\":\"<p>Welcome to Christ the King Lutheran School. We\\u2019re glad you have come to our website to learn more about the great school God has given to us. Please look through the information below to learn more about CtK. If you have any questions, please don\\u2019t hesitate to give us a call or stop by for a visit.<\\/p>\",\"curriculum\":null}','{\"meta_title\":\"Christian Education in Kitsap County\",\"status\":\"published\"}',NULL,NULL,NULL),(363,945,'school_home','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 20:30:08\",\"meta_title\":\"Christian Education in Kitsap County\",\"meta_description\":null,\"page_title\":\"Christian Education in Kitsap County\",\"page_subtitle\":null,\"introduction\":\"<p>Welcome to Christ the King Lutheran School. We\\u2019re glad you have come to our website to learn more about the great school God has given to us. Please look through the information below to learn more about CtK. If you have any questions, please don\\u2019t hesitate to give us a call or stop by for a visit.<\\/p>\",\"curriculum\":\"<p>The curriculum of our school meets all the requirements of the state of Washington\\u2019s Office of Superintendent of Public Instruction (OSPI) and follows the guidelines prepared by the Commission on Lutheran Schools of the Wisconsin Evangelical Lutheran Synod (WELS). Our school year fulfills the hourly requirements of the Washington State Board of Education. We are approved by the Washington State Board of Education.<\\/p>\"}','{\"curriculum\":\"<p>The curriculum of our school meets all the requirements of the state of Washington\\u2019s Office of Superintendent of Public Instruction (OSPI) and follows the guidelines prepared by the Commission on Lutheran Schools of the Wisconsin Evangelical Lutheran Synod (WELS). Our school year fulfills the hourly requirements of the Washington State Board of Education. We are approved by the Washington State Board of Education.<\\/p>\"}',NULL,NULL,NULL),(364,946,'school_pages','1','{\"id\":\"1\",\"status\":\"published\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:29:09\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-16 21:29:09\",\"meta_title\":\"Enrollment\",\"meta_description\":null,\"page_title\":\"Enrollment at Christ the King\",\"page_subtitle\":null,\"content\":\"<h5>Are you interested in enrolling your child at Christ the King? Following are the steps of our enrollment process.<\\/h5><p>    What grade(s) are you interested in learning about? Please complete our CtK School Interest Form. We\\u2019ll contact you with information about the grade(s) you request.<\\/p><p>    We would love to meet your family, answer any questions you have, and tell you about the quality, Christ-centered education we offer at Christ the King. Please call our school (360-692-8799) and set up at a time when you can come for a visit to receive information, take a tour of our school, and meet our principal and teachers.<\\/p><p>    After you have read through all our school information, received answers to your questions, and have decided Christ the King is the school for your child, we\\u2019ll provide you a link to set up an account on TADS. TADS is a company Christ the King uses to set up and manage tuition collection and financial aid.<\\/p><p>    After you have completed and submitted your application, our principal will review your application. Approvals are typically processed in one to two business days.<\\/p><p>    Once your application is approved, your family will move into the enrollment phase where you will complete some additional forms.<\\/p><p>    If you need some help with your application, or you would like to submit a paper application, please contact our school office at 360-692-8799.<\\/p><h2>Admissions<\\/h2><p>Christ the King Lutheran Church and School exists to GLORIFY the triune God in worship, NURTURE our families through the study of God\\u2019s Word and Christian Education, and PROCLAIM the gospel of Jesus Christ to our community and the world. Our school is a wonderful blessing God has given us to share his gospel message with his little lambs.<\\/p><h3>Returning Families<\\/h3><p>Our returning families do not need to complete an application. TADS will send your system access information to the email address that Christ the King has on file. If you have any questions, please contact the school office.<\\/p><h3>Financial Aid<\\/h3><p>Providing quality Christian education is an integral part of the mission at Christ the King Lutheran Church. We strive to provide affordable solutions for families by subsidizing every child\\u2019s education. Families may request additional aid through the financial aid application process. We understand that family circumstances change; therefore, we accept applications throughout the year.<\\/p><h3>Tuition Discounts<\\/h3><p>Tuition discounts are available to qualifying families. Multiple student credits are also available for families with additional children. Please inquire for more information.<\\/p>\",\"primary_image\":null}','{\"status\":\"published\",\"meta_title\":\"Enrollment\",\"page_title\":\"Enrollment at Christ the King\",\"content\":\"<h5>Are you interested in enrolling your child at Christ the King? Following are the steps of our enrollment process.<\\/h5><p>    What grade(s) are you interested in learning about? Please complete our CtK School Interest Form. We\\u2019ll contact you with information about the grade(s) you request.<\\/p><p>    We would love to meet your family, answer any questions you have, and tell you about the quality, Christ-centered education we offer at Christ the King. Please call our school (360-692-8799) and set up at a time when you can come for a visit to receive information, take a tour of our school, and meet our principal and teachers.<\\/p><p>    After you have read through all our school information, received answers to your questions, and have decided Christ the King is the school for your child, we\\u2019ll provide you a link to set up an account on TADS. TADS is a company Christ the King uses to set up and manage tuition collection and financial aid.<\\/p><p>    After you have completed and submitted your application, our principal will review your application. Approvals are typically processed in one to two business days.<\\/p><p>    Once your application is approved, your family will move into the enrollment phase where you will complete some additional forms.<\\/p><p>    If you need some help with your application, or you would like to submit a paper application, please contact our school office at 360-692-8799.<\\/p><h2>Admissions<\\/h2><p>Christ the King Lutheran Church and School exists to GLORIFY the triune God in worship, NURTURE our families through the study of God\\u2019s Word and Christian Education, and PROCLAIM the gospel of Jesus Christ to our community and the world. Our school is a wonderful blessing God has given us to share his gospel message with his little lambs.<\\/p><h3>Returning Families<\\/h3><p>Our returning families do not need to complete an application. TADS will send your system access information to the email address that Christ the King has on file. If you have any questions, please contact the school office.<\\/p><h3>Financial Aid<\\/h3><p>Providing quality Christian education is an integral part of the mission at Christ the King Lutheran Church. We strive to provide affordable solutions for families by subsidizing every child\\u2019s education. Families may request additional aid through the financial aid application process. We understand that family circumstances change; therefore, we accept applications throughout the year.<\\/p><h3>Tuition Discounts<\\/h3><p>Tuition discounts are available to qualifying families. Multiple student credits are also available for families with additional children. Please inquire for more information.<\\/p>\"}',NULL,NULL,NULL),(365,947,'directus_fields','285','{\"id\":\"285\",\"collection\":\"church_pages\",\"field\":\"slug\",\"type\":\"string\",\"interface\":\"slug\",\"options\":{\"placeholder\":\"A unique label...\",\"forceLowercase\":true},\"locked\":false,\"validation\":null,\"required\":false,\"readonly\":false,\"hidden_detail\":false,\"hidden_browse\":false,\"sort\":null,\"width\":\"full\",\"group\":null,\"note\":null,\"translation\":null}','{\"collection\":\"church_pages\",\"field\":\"slug\",\"type\":\"string\",\"interface\":\"slug\",\"required\":false,\"sort\":null,\"note\":null,\"hidden_detail\":false,\"hidden_browse\":false,\"options\":{\"placeholder\":\"A unique label...\",\"forceLowercase\":true},\"id\":null,\"readonly\":false,\"validation\":null,\"width\":\"full\"}',NULL,NULL,NULL),(366,948,'directus_fields','257','{\"id\":\"257\",\"collection\":\"church_pages\",\"field\":\"id\",\"type\":\"integer\",\"interface\":\"primary-key\",\"options\":null,\"locked\":false,\"validation\":null,\"required\":false,\"readonly\":false,\"hidden_detail\":true,\"hidden_browse\":true,\"sort\":\"1\",\"width\":\"full\",\"group\":null,\"note\":null,\"translation\":null}','{\"sort\":1}',NULL,NULL,NULL),(367,949,'directus_fields','258','{\"id\":\"258\",\"collection\":\"church_pages\",\"field\":\"status\",\"type\":\"status\",\"interface\":\"status\",\"options\":{\"status_mapping\":{\"published\":{\"name\":\"Published\",\"value\":\"published\",\"text_color\":\"white\",\"background_color\":\"accent\",\"browse_subdued\":false,\"browse_badge\":true,\"soft_delete\":false,\"published\":true},\"draft\":{\"name\":\"Draft\",\"value\":\"draft\",\"text_color\":\"white\",\"background_color\":\"blue-grey-100\",\"browse_subdued\":true,\"browse_badge\":true,\"soft_delete\":false,\"published\":false},\"deleted\":{\"name\":\"Deleted\",\"value\":\"deleted\",\"text_color\":\"white\",\"background_col