only\":false,\"hidden_detail\":false,\"hidden_browse\":false,\"sort\":\"14\",\"width\":\"full\",\"group\":null,\"note\":null,\"translation\":null}','{\"sort\":14}',NULL,NULL,NULL),(395,977,'church_pages','1','{\"id\":\"1\",\"status\":\"published\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:20:22\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-16 21:35:58\",\"meta_title\":\"What to expect\",\"meta_description\":\"Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments.\",\"page_title\":\"Christ\'s Love, Our Community\",\"page_subtitle\":\"What to expect when you visit\",\"content\":\"<h2>What you can expect<\\/h2><p>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/p><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\",\"primary_image\":null,\"slug\":\"what-to-expect\"}','{\"slug\":\"what-to-expect\"}',NULL,NULL,NULL),(396,978,'school_pages','1','{\"id\":\"1\",\"status\":\"published\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:29:09\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-16 21:36:09\",\"meta_title\":\"Enrollment\",\"meta_description\":null,\"page_title\":\"Enrollment at Christ the King\",\"page_subtitle\":null,\"content\":\"<h5>Are you interested in enrolling your child at Christ the King? Following are the steps of our enrollment process.<\\/h5><p>    What grade(s) are you interested in learning about? Please complete our CtK School Interest Form. We\\u2019ll contact you with information about the grade(s) you request.<\\/p><p>    We would love to meet your family, answer any questions you have, and tell you about the quality, Christ-centered education we offer at Christ the King. Please call our school (360-692-8799) and set up at a time when you can come for a visit to receive information, take a tour of our school, and meet our principal and teachers.<\\/p><p>    After you have read through all our school information, received answers to your questions, and have decided Christ the King is the school for your child, we\\u2019ll provide you a link to set up an account on TADS. TADS is a company Christ the King uses to set up and manage tuition collection and financial aid.<\\/p><p>    After you have completed and submitted your application, our principal will review your application. Approvals are typically processed in one to two business days.<\\/p><p>    Once your application is approved, your family will move into the enrollment phase where you will complete some additional forms.<\\/p><p>    If you need some help with your application, or you would like to submit a paper application, please contact our school office at 360-692-8799.<\\/p><h2>Admissions<\\/h2><p>Christ the King Lutheran Church and School exists to GLORIFY the triune God in worship, NURTURE our families through the study of God\\u2019s Word and Christian Education, and PROCLAIM the gospel of Jesus Christ to our community and the world. Our school is a wonderful blessing God has given us to share his gospel message with his little lambs.<\\/p><h3>Returning Families<\\/h3><p>Our returning families do not need to complete an application. TADS will send your system access information to the email address that Christ the King has on file. If you have any questions, please contact the school office.<\\/p><h3>Financial Aid<\\/h3><p>Providing quality Christian education is an integral part of the mission at Christ the King Lutheran Church. We strive to provide affordable solutions for families by subsidizing every child\\u2019s education. Families may request additional aid through the financial aid application process. We understand that family circumstances change; therefore, we accept applications throughout the year.<\\/p><h3>Tuition Discounts<\\/h3><p>Tuition discounts are available to qualifying families. Multiple student credits are also available for families with additional children. Please inquire for more information.<\\/p>\",\"primary_image\":null,\"slug\":\"enrollment\"}','{\"slug\":\"enrollment\"}',NULL,NULL,NULL),(397,979,'directus_fields','287','{\"id\":\"287\",\"collection\":\"people\",\"field\":\"works_for\",\"type\":\"string\",\"interface\":\"dropdown\",\"options\":{\"choices\":{\"school\":\"School\",\"church\":\"Church\"},\"placeholder\":\"Choose an option...\",\"formatting\":true},\"locked\":false,\"validation\":null,\"required\":false,\"readonly\":false,\"hidden_detail\":false,\"hidden_browse\":false,\"sort\":null,\"width\":\"full\",\"group\":null,\"note\":null,\"translation\":null}','{\"collection\":\"people\",\"field\":\"works_for\",\"type\":\"string\",\"interface\":\"dropdown\",\"required\":false,\"sort\":null,\"note\":null,\"hidden_detail\":false,\"hidden_browse\":false,\"options\":{\"choices\":{\"school\":\"School\",\"church\":\"Church\"},\"placeholder\":\"Choose an option...\",\"formatting\":true},\"id\":null,\"readonly\":false,\"validation\":null,\"width\":\"full\"}',NULL,NULL,NULL),(398,980,'directus_files','2','{\"id\":\"2\",\"storage\":\"local\",\"filename\":\"ca79020a-ca37-5958-8c23-b0917482b7f3.jpeg\",\"title\":\"2018 10 10 18.18.57 3\",\"type\":\"image\\/jpeg\",\"uploaded_by\":\"1\",\"uploaded_on\":\"2019-09-17 01:42:17\",\"charset\":\"binary\",\"filesize\":\"125408\",\"width\":\"640\",\"height\":\"800\",\"duration\":\"0\",\"embed\":null,\"folder\":null,\"description\":\"\",\"location\":\"\",\"tags\":[],\"checksum\":\"aed4ed6d5ef7676c510a71856c683366\"