 glorify God as we preach and teach the inerrant Holy Scriptures and administer God\\u2019s sacraments. Therefore, our mission is to grow in God\\u2019s Word, to gather around His Word with fellow Christians, and to go into our community and the world with the good news of eternal life through faith in Jesus Christ.<\\/p><p>Christ the King Evangelical Lutheran Church strives to be a Christ-centered family committed to God\\u2019s true Word as we faithfully learn, worship, serve, and care for one another, sharing the love of Christ in a spirit of praise and joy within our church and community.<\\/p>\"}','{\"status\":\"published\"}',NULL,NULL,NULL),(499,1090,'directus_fields','309','{\"id\":\"309\",\"collection\":\"school_pages\",\"field\":\"featured_news\",\"type\":\"o2m\",\"interface\":\"one-to-many\",\"options\":{\"fields\":\"title\",\"template\":\"{{ title }}\",\"delete_mode\":\"relation\",\"allow_create\":true,\"allow_select\":true},\"locked\":false,\"validation\":null,\"required\":false,\"readonly\":false,\"hidden_detail\":false,\"hidden_browse\":false,\"sort\":null,\"width\":\"full\",\"group\":null,\"note\":null,\"translation\":null}','{\"collection\":\"school_pages\",\"field\":\"featured_news\",\"type\":\"o2m\",\"interface\":\"one-to-many\",\"required\":false,\"sort\":null,\"note\":null,\"hidden_detail\":false,\"hidden_browse\":false,\"options\":{\"fields\":\"title\",\"template\":\"{{ title }}\",\"delete_mode\":\"relation\",\"allow_create\":true,\"allow_select\":true},\"id\":null,\"readonly\":false,\"validation\":null,\"width\":\"full\"}',NULL,NULL,NULL),(500,1091,'directus_relations','18','{\"id\":\"18\",\"collection_many\":\"school_news\",\"field_many\":\"slug\",\"collection_one\":\"school_pages\",\"field_one\":\"featured_news\",\"junction_field\":null}','{\"id\":null,\"collection_many\":\"school_news\",\"field_many\":\"slug\",\"collection_one\":\"school_pages\",\"field_one\":\"featured_news\"}',NULL,NULL,NULL),(501,1092,'school_news','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:26:48\",\"title\":\"School Accreditation\",\"slug\":null,\"key_image\":null,\"publish_date\":null,\"content\":\"<p>Christ the King is an exemplary accredited school by WELSSA (Wisconsin Evangelical Lutheran Synod School Accreditation) and NCPSA (National Council for Private School Accreditation).<\\/p><p>In October 2017, Christ the King had four site team members visiting our campus to conduct our accreditation self-study review (the culminating event of more than 7 years of work). The team visited classrooms, spoke with teachers, staff, parents, Board of Ed members, and students, and reviewed the evidence we provided for all 242 sub-standards in the accreditation self-study. During the final report, the site team identified commendations and recommendations in each of the 15 standards. CtK fully met 229 of the 242 sub-standards and an additional 10 standards as partially met. This gives us a 97% ranking and exemplary accreditation status!<\\/p><p>Christ the King thanks the site visit team for taking time out of their busy lives to help us improve our ministry at CtK, our parents and students for their loving support; our faculty and staff for their dedication to teaching and caring for God\\u2019s little lambs; the Board of Ed for their guidance and support; and our congregation for staying committed to this process and the amazing support they give the school. To God be the Glory!<\\/p><p>Click here to view the final report from the site visit team.<\\/p>\"}','{\"status\":\"published\",\"content\":\"<p>Christ the King is an exemplary accredited school by WELSSA (Wisconsin Evangelical Lutheran Synod School Accreditation) and NCPSA (National Council for Private School Accreditation).<\\/p><p>In October 2017, Christ the King had four site team members visiting our campus to conduct our accreditation self-study review (the culminating event of more than 7 years of work). The team visited classrooms, spoke with teachers, staff, parents, Board of Ed members, and students, and reviewed the evidence we provided for all 242 sub-standards in the accreditation self-study. During the final report, the site team identified commendations and recommendations in each of the 15 standards. CtK fully met 229 of the 242 sub-standards and an additional 10 standards as partially met. This gives us a 97% ranking and exemplary accreditation status!<\\/p><p>Christ the King thanks the site visit team for taking time out of their busy lives to help us improve our ministry at CtK, our parents and students for their loving support; our faculty and staff for their dedication to teaching and caring for God\\u2019s little lambs; the Board of Ed for their guidance and support; and our congregation for staying committed to this process and the amazing support they give the school. To God be the Glory!<\\/p><p>Click here to view the final report from the site visit team.<\\/p>\",\"title\":\"School Accreditation\"}',NULL,NULL,NULL),(502,1094,'directus_fields','310','{\"id\":\"310\",\"collection\":\"school_home\",\"field\":\"featured_news\",\"type\":\"o2m\",\"interface\":\"one-to-many\",\"options\":{\"fields\":\"title\",\"template\":\"{{ title }}\",\"delete_mode\":\"relation\",\"allow_create\":true,\"allow_select\":true},\"locked\":false,\"validation\":null,\"required\":false,\"readonly\":false,\"hidden_detail\":false,\"hidden_browse\":false,\"sort\":null,\"width\":\"full\",\"group\":null,\"note\":null,\"translation\":null}','{\"collection\":\"school_home\",\"field\":\"featured_news\",\"type\":\"o2m\",\"interface\":\"one-to-many\",\"required\":false,\"sort\":null,\"note\":null,\"hidden_detail\":false,\"hidden_browse\":false,\"options\":{\"fields\":\"title\",\"template\":\"{{ title }}\",\"delete_mode\":\"relation\",\"allow_create\":true,\"allow_select\":true},\"id\":null,\"readonly\":false,\"validation\":null,\"width\":\"full\"}',NULL,NULL,NULL),(503,1095,'directus_relations','18','{\"id\":