r mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/p><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\",\"primary_image\":null,\"slug\":\"1\"}','{\"status\":\"published\",\"sort\":null,\"created_by\":1,\"created_on\":\"2019-09-16 21:20:22\",\"modified_by\":1,\"modified_on\":\"2019-09-16 21:35:58\",\"meta_title\":\"What to expect\",\"meta_description\":\"Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments.\",\"page_title\":\"Christ\'s Love, Our Community\",\"page_subtitle\":\"What to expect when you visit\",\"content\":\"<h2>What you can expect<\\/h2><p>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/p><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\",\"primary_image\":null,\"slug\":\"1\"}','home_navigation',NULL,1),(528,1120,'school_pages','1','{\"id\":\"1\",\"status\":\"published\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:29:09\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-16 22:32:53\",\"meta_title\":\"Enrollment\",\"meta_description\":null,\"page_title\":\"Enrollment at Christ the King\",\"page_subtitle\":null,\"content\":\"<h5>Are you interested in enrolling your child at Christ the King? Following are the steps of our enrollment process.<\\/h5><p>    What grade(s) are you interested in learning about? Please complete our CtK School Interest Form. We\\u2019ll contact you with information about the grade(s) you request.<\\/p><p>    We would love to meet your family, answer any questions you have, and tell you about the quality, Christ-centered education we offer at Christ the King. Please call our school (360-692-8799) and set up at a time when you can come for a visit to receive information, take a tour of our school, and meet our principal and teachers.<\\/p><p>    After you have read through all our school information, received answers to your questions, and have decided Christ the King is the school for your child, we\\u2019ll provide you a link to set up an account on TADS. TADS is a company Christ the King uses to set up and manage tuition collection and financial aid.<\\/p><p>    After you have completed and submitted your application, our principal will review your application. Approvals are typically processed in one to two business days.<\\/p><p>    Once your application is approved, your family will move into the enrollment phase where you will complete some additional forms.<\\/p><p>    If you need some help with your application, or you would like to submit a paper application, please contact our school office at 360-692-8799.<\\/p><h2>Admissions<\\/h2><p>Christ the King Lutheran Church and School exists to GLORIFY the triune God in worship, NURTURE our families through the study of God\\u2019s Word and Christian Education, and PROCLAIM the gospel of Jesus Christ to our community and the world. Our school is a wonderful blessing God has given us to share his gospel message with his little lambs.<\\/p><h3>Returning Families<\\/h3><p>Our returning families do not need to complete an application. TADS will send your system access information to the email address that Christ the King has on file. If you have any questions, please contact the school office.<\\/p><h3>Financial Aid<\\/h3><p>Providing quality Christian education is an integral part of the mission at Christ the King Lutheran Church. We strive to provide affordable solutions for families by subsidizing every child\\u2019s education. Families may request additional aid through the financial aid application process. We understand that family circumstances change; therefore, we accept applications throughout the year.<\\/p><h3>Tuition Discounts<\\/h3><p>Tuition discounts are available to qualifying families. Multiple student credits are also available for families with additional children. Please inquire for more information.<\\/p>\",\"primary_image\":null,\"slug\":\"1\"}','{\"status\":\"published\",\"sort\":null,\"created_by\":1,\"created_on\":\"2019-09-16 21:29:09\",\"modified_by\":1,\"modified_on\":\"2019-09-16 21:36:09\",\"meta_title\":\"Enrollment\",\"meta_description\":null,\"page_title\":\"Enrollment at Christ the King\",\"page_subtitle\":null,\"content\":\"<h5>Are you interested in enrolling your child at Christ the King? Following are the steps of our enrollment process.<\\/h5><p>    What grade(s) are you interested in learning about? Please complete our CtK School Interest Form. We\\u2019ll contact you with information about the grade(s) you request.<\\/p><p>    We would love to meet your family, answer any questions you have, and tell you about the quality, Christ-centered education we offer at Christ the King. Please call our school (360-692-8799) and set up at a time when you can come for a visit to receive information, take a tour of our school, and meet our principal and teachers.<\\/p><p>    After you have read through all our school information, received answers to your questions, and have decided Christ the King is the school for your child, we\\u2019ll provide you a link to set up an account on TADS. TADS is a company Christ the King uses to set up and manage tuition collection and financial aid.<\\/p><p>    After you have completed and submitted your application, our principal will review your application. Approvals are typically processed in one to two business days.<\\/p><p>    Once your application is approved, your family will move into the enrollment phase where you will complete some additional forms.<\\/p><p>    If you need some help with your application, or you would like to submit a paper application, please contact our school office at 360-692-8799.<\\/p><h2>Admissions<\\/h2><p>Christ the King Lutheran Church and School exists to GLORIFY the triune God in worship, NURTURE our families through the study of God\\u2019s Word and Christian Education, and PROCLAIM the gospel of Jesus Christ to our community and the world. Our school is a wonderful blessing God has given us to share his gospel message with his little lambs.<\\/p><h3>Returning Families<\\/h3><p>Our returning families do not need to complete an application. TADS will send your system access information to the email address that Christ the King has on file. If you have any questions, please contact the school office.<\\/p><h3>Financial Aid<\\/h3><p>Providing quality Christian education is an integral part of the mission at Christ the King Lutheran Church. We strive to provide affordable solutions for families by subsidizing every child\\u2019s education. Families may request additional aid through the financial aid application process. We understand that family circumstances change; therefore, we accept applications throughout the year.<\\/p><h3>Tuition Discounts<\\/h3><p>Tuition discounts are available to qualifying families. Multiple student credits are also available for families with additional children. Please inquire for more information.<\\/p>\",\"primary_image\":null,\"slug\":\"1\"}','home_navigation',NULL,1),(529,1121,'directus_collections','home_navigation','{\"collection\":\"home_navigation\",\"managed\":true,\"hidden\":false,\"single\":true,\"icon\":null,\"note\":null,\"translation\":null}','{\"single\":true}',NULL,NULL,NULL),(530,1163,'church_home','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 20:30:15\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-18 22:14:01\",\"meta_title\":\"WELS Church in Kitsap County\",\"meta_description\":\"Lutheran church serving Kitsap County Christ the King Lutheran Chuch & School.\",\"page_title\":\"Lutheran Church Serving Kitsap County\",\"page_subtitle\":null,\"introduction\":\"<h2>Our Mission<\\/h2><p>Christ\\u2019s love compels and the Holy Spirit empowers Christ the King Evangelical Lutheran Church to glorify God as we preach and teach the inerrant Holy Scriptures and administer God\\u2019s sacraments. Therefore, our mission is to grow in God\\u2019s Word, to gather around His Word with fellow Christians, and to go into our community and the world with the good news of eternal life through faith in Jesus Christ.<\\/p><p>Christ the King Evangelical Lutheran Church strives to be a Christ-centered family committed to God\\u2019s true Word as we faithfully learn, worship, serve, and care for one another, sharing the love of Christ in a spirit of praise and joy within our church and community.<\\/p>\"}','[]',NULL,NULL,NULL),(531,1164,'church_news','2','{\"id\":\"2\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:20:37\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-18 22:14:01\",\"title\":\"Summer Soccer Camps\",\"slug\":\"1\",\"primary_image\":\"3\",\"publish_date\":null,\"content\":\"<h2>Join us for our 2019 kids\\u2019 summer soccer camps!<\\/h2><p>We will open with a devotion, go to skills stations to learn some basic skills from our high school level instructors, take a snack break, and then play a scrimmage. There will be plenty of time for participants to learn that their gifts come from the Lord \\u2013 in sports and everything else in life! Invite friends and cousins to come play soccer with us!<\\/p><h3>Preschool (4-year-olds) and Kindergarten: June 4-6 from 6:00-7:00pm.<\\/h3><p>Registration costs $35 per child.<\\/p><h3>1st-4th Grade: June 11-13 from 6:00-7:30pm.<\\/h3><p>Registration costs $40 per child.<\\/p><p>Each child who registers will get:<\\/p><ul><li>A soccer camp t-shirt<\\/li><li>Reusable water bottle<\\/li><li>Soccer ball<\\/li><\\/ul><p>Register your child today!<\\/p>\"}','{\"primary_image\":3,\"slug\":\"1\"}','church_home','1',1),(532,1165,'church_news','3','{\"id\":\"3\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:21:34\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-18 22:14:01\",\"title\":\"Some other content\",\"slug\":\"1\",\"primary_image\":\"9\",\"publish_date\":null,\"content\":\"<p>something<\\/p>\"}','{\"primary_image\":9,\"slug\":\"1\"}','church_home','1',1),(533,1170,'church_news','2','{\"id\":\"2\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:20:37\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-18 22:15:54\",\"title\":\"Summer Soccer Camps\",\"slug\":\"summer-soccer-camps\",\"primary_image\":\"3\",\"publish_date\":null,\"content\":\"<h2>Join us for our 2019 kids\\u2019 summer soccer camps!<\\/h2><p>We will open with a devotion, go to skills stations to learn some basic skills from our high school level instructors, take a snack break, and then play a scrimmage. There will be plenty of time for participants to learn that their gifts come from the Lord \\u2013 in sports and everything else in life! Invite friends and cousins to come play soccer with us!<\\/p><h3>Preschool (4-year-olds) and Kindergarten: June 4-6 from 6:00-7:00pm.<\\/h3><p>Registration costs $35 per child.<\\/p><h3>1st-4th Grade: June 11-13 from 6:00-7:30pm.<\\/h3><p>Registration costs $40 per c