Board of Education. We are approved by the Washington State Board of Education.<\\/p>\"}','{\"status\":\"published\",\"created_by\":1,\"created_on\":\"2019-09-16 20:30:08\",\"meta_title\":\"Christian Education in Kitsap County\",\"meta_description\":null,\"page_title\":\"Christian Education in Kitsap County\",\"page_subtitle\":null,\"introduction\":\"<p>Welcome to Christ the King Lutheran School. We\\u2019re glad you have come to our website to learn more about the great school God has given to us. Please look through the information below to learn more about CtK. If you have any questions, please don\\u2019t hesitate to give us a call or stop by for a visit.<\\/p>\",\"curriculum\":\"<p>The curriculum of our school meets all the requirements of the state of Washington\\u2019s Office of Superintendent of Public Instruction (OSPI) and follows the guidelines prepared by the Commission on Lutheran Schools of the Wisconsin Evangelical Lutheran Synod (WELS). Our school year fulfills the hourly requirements of the Washington State Board of Education. We are approved by the Washington State Board of Education.<\\/p>\"}',NULL,NULL,NULL),(577,1282,'school_home','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 20:30:08\",\"meta_title\":\"Christian Education in Kitsap County\",\"meta_description\":null,\"page_title\":\"Christian Education in Kitsap County\",\"page_subtitle\":null,\"introduction\":\"<p>Welcome to Christ the King Lutheran School. We\\u2019re glad you have come to our website to learn more about the great school God has given to us. Please look through the information below to learn more about CtK. If you have any questions, please don\\u2019t hesitate to give us a call or stop by for a visit.<\\/p>\",\"curriculum\":\"<p>The curriculum of our school meets all the requirements of the state of Washington\\u2019s Office of Superintendent of Public Instruction (OSPI) and follows the guidelines prepared by the Commission on Lutheran Schools of the Wisconsin Evangelical Lutheran Synod (WELS). Our school year fulfills the hourly requirements of the Washington State Board of Education. We are approved by the Washington State Board of Education.<\\/p>\"}','[]',NULL,NULL,NULL),(578,1283,'school_news','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:26:48\",\"title\":\"School Accreditation\",\"slug\":\"1\",\"key_image\":null,\"publish_date\":null,\"content\":\"<p>Christ the King is an exemplary accredited school by WELSSA (Wisconsin Evangelical Lutheran Synod School Accreditation) and NCPSA (National Council for Private School Accreditation).<\\/p><p>In October 2017, Christ the King had four site team members visiting our campus to conduct our accreditation self-study review (the culminating event of more than 7 years of work). The team visited classrooms, spoke with teachers, staff, parents, Board of Ed members, and students, and reviewed the evidence we provided for all 242 sub-standards in the accreditation self-study. During the final report, the site team identified commendations and recommendations in each of the 15 standards. CtK fully met 229 of the 242 sub-standards and an additional 10 standards as partially met. This gives us a 97% ranking and exemplary accreditation status!<\\/p><p>Christ the King thanks the site visit team for taking time out of their busy lives to help us improve our ministry at CtK, our parents and students for their loving support; our faculty and staff for their dedication to teaching and caring for God\\u2019s little lambs; the Board of Ed for their guidance and support; and our congregation for staying committed to this process and the amazing support they give the school. To God be the Glory!<\\/p><p>Click here to view the final report from the site visit team.<\\/p>\",\"link\":\"1\"}','{\"status\":\"published\",\"created_by\":1,\"created_on\":\"2019-09-16 22:26:48\",\"title\":\"School Accreditation\",\"slug\"