":\"{{ meta_title }}\",\"delete_mode\":\"relation\",\"allow_create\":true,\"allow_select\":true},\"id\":null,\"readonly\":false,\"validation\":null,\"width\":\"full\"}',NULL,NULL,NULL),(656,1460,'directus_relations','24','{\"id\":\"24\",\"collection_many\":\"church_pages\",\"field_many\":\"link\",\"collection_one\":\"home_navigation\",\"field_one\":\"church_pages\",\"junction_field\":null}','{\"collection_many\":\"church_pages\",\"field_many\":\"link\",\"collection_one\":\"home_navigation\",\"field_one\":\"church_pages\"}',NULL,NULL,NULL),(657,1461,'directus_fields','330','{\"id\":\"330\",\"collection\":\"home_navigation\",\"field\":\"school_pages\",\"type\":\"o2m\",\"interface\":\"one-to-many\",\"options\":{\"fields\":\"meta_title\",\"template\":\"{{ meta_title }}\",\"delete_mode\":\"relation\",\"allow_create\":true,\"allow_select\":true},\"locked\":false,\"validation\":null,\"required\":false,\"readonly\":false,\"hidden_detail\":false,\"hidden_browse\":false,\"sort\":null,\"width\":\"full\",\"group\":null,\"note\":null,\"translation\":null}','{\"collection\":\"home_navigation\",\"field\":\"school_pages\",\"type\":\"o2m\",\"interface\":\"one-to-many\",\"required\":false,\"sort\":null,\"note\":null,\"hidden_detail\":false,\"hidden_browse\":false,\"options\":{\"fields\":\"meta_title\",\"template\":\"{{ meta_title }}\",\"delete_mode\":\"relation\",\"allow_create\":true,\"allow_select\":true},\"id\":null,\"readonly\":false,\"validation\":null,\"width\":\"full\"}',NULL,NULL,NULL),(658,1462,'directus_relations','23','{\"id\":\"23\",\"collection_many\":\"school_pages\",\"field_many\":\"link\",\"collection_one\":\"home_navigation\",\"field_one\":\"school_pages\",\"junction_field\":null}','{\"collection_many\":\"school_pages\",\"field_many\":\"link\",\"collection_one\":\"home_navigation\",\"field_one\":\"school_pages\"}',NULL,NULL,NULL),(659,1463,'school_pages','1','{\"id\":\"1\",\"status\":\"published\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:29:09\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-19 17:33:43\",\"meta_title\":\"Enrollment\",\"meta_description\":null,\"page_title\":\"Enrollment at Christ the King\",\"page_subtitle\":null,\"content\":\"<h5>Are you interested in enrolling your child at Christ the King? Following are the steps of our enrollment process.<\\/h5><p>    What grade(s) are you interested in learning about? Please complete our CtK School Interest Form. We\\u2019ll contact you with information about the grade(s) you request.<\\/p><p>    We would love to meet your family, answer any questions you have, and tell you about the quality, Christ-centered education we offer at Christ the King. Please call our school (360-692-8799) and set up at a time when you can come for a visit to receive information, take a tour of our school, and meet our principal and teachers.<\\/p><p>    After you have read through all our school information, received answers to your questions, and have decided Christ the King is the school for your child, we\\u2019ll provide you a link to set up an account on TADS. TADS is a company Christ the King uses to set up and manage tuition collection and financial aid.<\\/p><p>    After you have completed and submitted your application, our principal will review your application. Approvals are typically processed in one to two business days.<\\/p><p>    Once your application is approved, your family will move into the enrollment phase where you will complete some additional forms.<\\/p><p>    If you need some help with your application, or you would like to submit a paper application, please contact our school office at 360-692-8799.<\\/p><h2>Admissions<\\/h2><p>Christ the King Lutheran Church and School exists to GLORIFY the triune God in worship, NURTURE our families through the study of God\\u2019s Word and Christian Education, and PROCLAIM the gospel of Jesus Christ to our community and the world. Our school is a wonderful blessing God has given us to share his gospel message with his little lambs.<\\/p><h3>Returning Families<\\/h3><p>Our returning families do not need to complete an application. TADS will send your system access information to the email address that Christ the King has on file. If you have any questions, please contact the school office.<\\/p><h3>Financial Aid<\\/h3><p>Providing quality Christian education is an integral part of the mission at Christ the King Lutheran Church. We strive to provide affordable solutions for families by subsidizing every child\\u2019s education. Families may request additional aid through the financial aid application process. We understand that family circumstances change; therefore, we accept applications throughout the year.<\\/p><h3>Tuition Discounts<\\/h3><p>Tuition discounts are available to qualifying families. Multiple student credits are also available for families with additional children. Please inquire for more information.<\\/p>\",\"primary_image\":null,\"link\":\"1\",\"slug\":\"enrollment\"}','{\"slug\":\"enrollment\"}',NULL,NULL,NULL),(660,1464,'church_pages','1','{\"id\":\"1\",\"status\":\"published\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:20:22\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-19 17:33:58\",\"meta_title\":\"What to expect\",\"meta_description\":\"Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments.\",\"page_title\":\"Christ\'s Love, Our Community\",\"page_subtitle\":\"What to expect when you visit\",\"content\":\"<h2>What you can expect<\\/h2><p>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/p><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\",\"primary_image\":null,\"link\":\"1\",\"slug\":\"what-to-expect\"}','{\"slug\":\"what-to-expect\"}',NULL,NULL,NULL),(661,1629,'church_pages','1','{\"id\":\"1\",\"status\":\"published\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:20:22\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-19 17:54:04\",\"meta_title\":\"What to expect\",\"meta_description\":\"Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments.\",\"page_title\":\"Christ\'s Love, Our Community\",\"page_subtitle\":\"What to expect when you visit\",\"content\":\"<h3>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/h3><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\",\"primary_image\":null,\"link\":\"1\",\"slug\":\"what-to-expect\"}','{\"content\":\"<h3>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/h3><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\"}',NULL,NULL,NULL),(662,1644,'directus_fields','237','{\"id\":\"237\",\"collection\":\"church_home\",\"field\":\"status\",\"type\":\"status\",\"interface\":\"status\",\"options\":{\"status_mapping\":{\"published\":{\"name\":\"Published\",\"value\":\"published\",\"text_color\":\"white\",\"background_color\":\"accent\",\"browse_subdued\":false,\"browse_badge\":true,\"soft_delete\":false,\"published\":true},\"draft\":{\"name\":\"Draft\",\"value\":\"draft\",\"text_color\":\"white\",\"background_color\":\"blue-grey-100\",\"browse_subdued\":true,\"browse_badge\":true,\"soft_delete\":false,\"published\":false},\"deleted\":{\"name\":\"Deleted\",\"value\":\"deleted\",\"text_color\":\"white\",\"background_color\":\"red\",\"browse_subdued\":true,\"browse_badge\":true,\"soft_delete\":true,\"published\":false}}},\"locked\":false,\"validation\":null,\"required\":false,\"readonly\":false,\"hidden_detail\":true,\"hidden_browse\":true,\"sort\":\"0\",\"width\":\"full\",\"group\":null,\"note\":\"\",\"translation\":null}','{\"sort\":0,\"type\":\"status\",\"interface\":\"status\",\"options\":{\"status_mapping\":{\"published\":{\"name\":\"Published\",\"value\":\"published\",\"text_color\":\"white\",\"background_color\":\"accent\",\"browse_subdued\":false,\"browse_badge\":true,\"soft_delete\":false,\"published\":true},\"draft\":{\"name\":\"Draft\",\"value\":\"draft\",\"text_color\":\"white\",\"background_color\":\"blue-grey-100\",\"browse_subdued\":true,\"browse_badge\":true,\"soft_delete\":false,\"published\":false},\"deleted\":{\"name\":\"Deleted\",\"value\":\"deleted\",\"text_color\":\"white\",\"background_color\":\"red\",\"browse_subdued\":true,\"browse_badge\":true,\"soft_delete\":true,\"published\":false}}},\"readonly\":false,\"required\":false,\"note\":\"\",\"hidden_detail\":true,\"hidden_browse\":true,\"validation\":null,\"width\":\"full\"}',NULL,NULL,NULL),(663,1645,'directus_fields','248','{\"id\":\"248\",\"collection\":\"school_home\",\"field\":\"status\",\"type\":\"status\",\"interface\":\"status\",\"options\":{\"status_mapping\":{\"published\":{\"name\":\"Published\",\"value\":\"published\",\"text_color\":\"white\",\"background_color\":\"accent\",\"browse_subdued\":false,\"browse_badge\":true,\"soft_delete\":false,\"published\":true},\"draft\":{\"name\":\"Draft\",\"value\":\"draft\",\"text_color\":\"white\",\"background_color\":\"blue-grey-100\",\"browse_subdued\":true,\"browse_badge\":true,\"soft_delete\":false,\"published\":false},\"deleted\":{\"name\":\"Deleted\",\"value\":\"deleted\",\"text_color\":\"white\",\"background_color\":\"red\",\"browse_subdued\":true,\"browse_badge\":true,\"soft_delete\":true,\"published\":false}}},\"locked\":false,\"validation\":null,\"required\":false,\"readonly\":false,\"hidden_detail\":true,\"hidden_browse\":true,\"sort\":\"0\",\"width\":\"full\",\"group\":null,\"note\":\"\",\"translation\":null}','{\"sort\":0,\"type\":\"status\",\"interface\":\"status\",\"options\":{\"status_mapping\":{\"published\":{\"name\":\"Published\",\"value\":\"published\",\"text_color\":\"white\",\"background_color\":\"accent\",\"browse_subdued\":false,\"browse_badge\":true,\"soft_delete\":false,\"published\":true},\"draft\":{\"name\":\"Draft\",\"value\":\"draft\",\"text_color\":\"white\",\"background_color\":\"blue-grey-100\",\"browse_subdued\":true,\"browse_badge\":true,\"soft_delete\":false,\"published\":false},\"deleted\":{\"name\":\"Deleted\",\"value\":\"deleted\",\"text_color\":\"white\",\"background_color\":\"red\",\"browse_subdued\":true,\"browse_badge\":true,\"soft_delete\":true,\"published\":false}}},\"readonly\":false,\"required\":false,\"note\":\"\",\"hidden_detail\":true,\"hidden_browse\":true,\"validation\":null,\"width\":\"full\"}',NULL,NULL,NULL),(664,1649,'directus_collections','home_navigation','{\"collection\":\"home_navigation\",\"managed\":true,\"hidden\":false,\"single\":true,\"icon\":\"more_horiz\",\"note\":null,\"translation\":null}','{\"icon\":\"more_horiz\"}',NULL,NULL,NULL),(665,1927,'school_news','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:26:48\",\"title\":\"School Accreditation\",\"publish_date\":\"2019-09-20\",\"content\":\"<p>Christ the King is an exemplary accredited school by WELSSA (Wisconsin Evangelical Lutheran Synod School Accreditation) and NCPSA (National Council for Private School Accreditation).<\\/p><p>In October 2017, Christ the King had four site team members visiting our campus to conduct our accreditation self-study review (the culminating event of more than 7 years of work). The team visited classrooms, spoke with teachers, staff, parents, Board of Ed members, and students, and reviewed the evidence we provided for all 242 sub-standards in the accreditation self-study. During the final report, the site team identified commendations and recommendations in each of the 15 standards. CtK fully met 229 of the 242 sub-standards and an additional 10 standards as partially met. This gives us a 97% ranking and exemplary accreditation status!<\\/p><p>Christ the King thanks the site visit team for taking time out of their busy lives to help us improve our ministry at CtK, our parents and students for their loving support; our faculty and staff for their dedication to teaching and caring for God\\u2019s little lambs; the Board of Ed for their guidance and support; and our congregation for staying committed to this process and the amazing support they give the school. To God be the Glory!<\\/p><p>Click here to view the final report from the site visit team.<\\/p>\",\"link\":\"1\",\"slug\":\"school-accreditation\",\"primary_image\":\"2\"}','{\"publish_date\":\"2019-09-20\"}',NULL,NULL,NULL),(666,1928,'church_news','2','{\"id\":\"2\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:20:37\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-21 12:58:20\",\"title\":\"Summer Soccer Camps\",\"primary_image\":\"3\",\"publish_date\":\"2019-09-12\",\"content\":\"<h2>Join us for our 2019 kids\\u2019 summer soccer camps!<\\/h2><p>We will open with a devotion, go to skills stations to learn some basic skills from our high school level instructors, take a snack break, and then play a scrimmage. There will be plenty of time for participants to learn that their gifts come from the Lord \\u2013 in sports and everything else in life! Invite friends and cousins to come play soccer with us!<\\/p><h3>Preschool (4-year-olds) and Kindergarten: June 4-6 from 6:00-7:00pm.<\\/h3><p>Registration costs $35 per child.<\\/p><h3>1st-4th Grade: June 11-13 from 6:00-7:30pm.<\\/h3><p>Registration costs $40 per child.<\\/p><p>Each child who registers will get:<\\/p><ul><li>A soccer camp t-shirt<\\/li><li>Reusable water bottle<\\/li><li>Soccer ball<\\/li><\\/ul><p>Register your child today!<\\/p>\",\"link\":\"1\",\"slug\":\"summer-soccer-camps\"}','{\"publish_date\":\"2019-09-12\"}',NULL,NULL,NULL),(667,1929,'church_news','3','{\"id\":\"3\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:21:34\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-21 12:58:26\",\"title\":\"Some other content\",\"primary_image\":\"9\",\"publish_date\":\"2019-09-17\",\"content\":\"<p>something<\\/p>\",\"link\":\"1\",\"slug\":\"some-other-content\"}','{\"publish_date\":\"2019-09-17\"}',NULL,NULL,NULL),(668,2054,'school_news','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:26:48\",\"title\":\"School Accreditation\",\"publish_date\":\"2019-09-10\",\"content\":\"<p>Christ the King is an exemplary accredited school by WELSSA (Wisconsin Evangelical Lutheran Synod School Accreditation) and NCPSA (National Council for Private School Accreditation).<\\/p><p>In October 2017, Christ the King had four site team members visiting our campus to conduct our accreditation self-study review (the culminating event of more than 7 years of work). The team visited classrooms, spoke with teachers, staff, parents, Board of Ed members, and students, and reviewed the evidence we provided for all 242 sub-standards in the accreditation self-study. During the final report, the site team identified commendations and recommendations in each of the 15 standards. CtK fully met 229 of the 242 sub-standards and an additional 10 standards as partially met. This gives us a 97% ranking and exemplary accreditation status!<\\/p><p>Christ the King thanks the site visit team for taking time out of their busy lives to help us improve our ministry at CtK, our parents and students for their loving support; our faculty and staff for their dedication to teaching and caring for God\\u2019s little lambs; the Board of Ed for their guidance and support; and our congregation for staying committed to this process and the amazing support they give the school. To God be the Glory!<\\/p><p>Click here to view the final report from the site visit team.<\\/p>\",\"link\":\"1\",\"slug\":\"school-accreditation\",\"primary_image\":\"2\"}','{\"publish_date\":\"2019-09-10\"}',NULL,NULL,NULL),(669,2594,'church_news','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:19:15\",\"modified_by\":\"1\",\"modified_on\":\"2019-09-22 19:46:55\",\"title\":\"CtK School Promo Video\",\"primary_image\":null,\"publish_date\":\"2017-11-03\",\"content\":\"<p>Content for the promo video<br><\\/p>\",\"link\":null,\"slug\":\"ctk-school-promo-video\"}','{\"slug\":\"ctk-school-promo-video\",\"content\":\"<p>Content for the promo video<br><\\/p>\"}',NULL,NULL,NULL),(670,2775,'directus_users','1','{\"id\":\"1\",\"status\":\"active\",\"first_name\":\"Admin\",\"last_name\":\"User\",\"email\":\"jfukura@gmail.com\",\"token\":null,\"timezone\":\"America\\/New_York\",\"locale\":\"en-US\",\"locale_options\":null,\"avatar\":null,\"company\"