re about the great school God has given to us.<\\/h3><div><p>Lorem ipsum dolor.<br><\\/p><\\/div>\",\"curriculum\":\"<p>The curriculum of our school meets all the requirements of the state of Washington\\u2019s Office of Superintendent of Public Instruction (OSPI) and follows the guidelines prepared by the Commission on Lutheran Schools of the Wisconsin Evangelical Lutheran Synod (WELS). Our school year fulfills the hourly requirements of the Washington State Board of Education. We are approved by the Washington State Board of Education.<\\/p>\"}','{\"introduction\":\"<h3>We\\u2019re glad you have come to our website to learn more about the great school God has given to us.<\\/h3><div><p>Lorem ipsum dolor.<br><\\/p><\\/div>\"}',NULL,NULL,NULL),(882,7701,'church_home','1','{\"id\":\"1\",\"status\":\"published\",\"created_by\":\"1\",\"created_on\":\"2019-09-16 20:30:15\",\"modified_by\":\"1\",\"modified_on\":\"2019-11-02 20:58:03\",\"meta_title\":\"WELS Church in Kitsap County\",\"meta_description\":\"Lutheran church serving Kitsap County Christ the King Lutheran Chuch & School.\",\"page_title\":\"Lutheran Church Serving Kitsap County\",\"page_subtitle\":null,\"introduction\":\"<h2>Our Mission<\\/h2><p>Christ\\u2019s love compels and the Holy Spirit empowers Christ the King Evangelical Lutheran Church to glorify God as we preach and teach the inerrant Holy Scriptures and administer God\\u2019s sacraments. Therefore, our mission is to grow in God\\u2019s Word, to gather around His Word with fellow Christians, and to go into our community and the world with the good news of eternal life through faith in Jesus Christ.<\\/p><p>Christ the King Evangelical Lutheran Church strives to be a Christ-centered family committed to God\\u2019s true Word as we faithfully learn, worship, serve, and care for one another, sharing the love of Christ in a spirit of praise and joy within our church and community.<\\/p><h2>What you can expect<\\/h2><p>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. The message of salvation through Jesus Christ is for everyone.<\\/p><p>We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\"}','{\"introduction\":\"<h2>Our Mission<\\/h2><p>Christ\\u2019s love compels and the Holy Spirit empowers Christ the King Evangelical Lutheran Church to glorify God as we preach and teach the inerrant Holy Scriptures and administer God\\u2019s sacraments. Therefore, our mission is to grow in God\\u2019s Word, to gather around His Word with fellow Christians, and to go into our community and the world with the good news of eternal life through faith in Jesus Christ.<\\/p><p>Christ the King Evangelical Lutheran Church strives to be a Christ-centered family committed to God\\u2019s true Word as we faithfully learn, worship, serve, and care for one another, sharing the love of Christ in a spirit of praise and joy within our church and community.<\\/p><h2>What you can expect<\\/h2><p>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. The message of salvation through Jesus Christ is for everyone.<\\/p><p>We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\"}',NULL,NULL,NULL),(883,7702,'home_navigation','1','{\"id\":\"1\",\"status\":\"published\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 22:32:52\"}','[]',NULL,NULL,NULL),(884,7703,'church_pages','1','{\"id\":\"1\",\"status\":\"published\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:20:22\",\"modified_by\":\"1\",\"modified_on\":\"2019-11-02 20:58:50\",\"meta_title\":\"What to expect\",\"meta_description\":\"Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments.\",\"page_title\":\"Christ\'s Love, Our Community\",\"page_subtitle\":\"What to expect when you visit\",\"content\":\"<h3>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/h3><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\",\"primary_image\":null,\"link\":null,\"slug\":\"what-to-expect\"}','{\"link\":null}','home_navigation','1',1),(885,7704,'church_pages','1','{\"id\":\"1\",\"status\":\"deleted\",\"sort\":null,\"created_by\":\"1\",\"created_on\":\"2019-09-16 21:20:22\",\"modified_by\":\"1\",\"modified_on\":\"2019-11-02 20:59:12\",\"meta_title\":\"What to expect\",\"meta_description\":\"Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments.\",\"page_title\":\"Christ\'s Love, Our Community\",\"page_subtitle\":\"What to expect when you visit\",\"content\":\"<h3>Worship is central to our mission of faithfully proclaiming God\\u2019s Word and administering the Sacraments. If you are new to Christ the King, here are a few things that you should expect.<\\/h3><p>People of all ages and backgrounds. The message of salvation through Jesus Christ is for everyone.<\\/p><p>If you have kids, they are going to have company. A number of our members have young families. We thank God for the children in our congregation and are blessed with facilities that are designed to accommodate the needs of families. We are going to sing, pray, and learn more about the hope we have in our Savior, Jesus Christ.<\\/p>\",\"primary_image\":null,\"link\":null,\"slug\":\"what-to-expect\"}','{\"status\":\"deleted\",\"id\":\"1\"}',NULL,NULL,NULL);
