INSERT INTO `school_home` VALUES (1,'published',1,'2019-09-16 20:30:08','Christian Education in Kitsap County',NULL,'Christian Education in Kitsap County','Welcome to Christ the King Lutheran School.','<h3>Weâ€™re glad you have come to our website to learn more about the great school God has given to us.</h3><div><p>Lorem ipsum dolor.<br></p></div>','<p>The curriculum of our school meets all the requirements of the state of Washingtonâ€™s Office of Superintendent of Public Instruction (OSPI) and follows the guidelines prepared by the Commission on Lutheran Schools of the Wisconsin Evangelical Lutheran Synod (WELS). Our school year fulfills the hourly requirements of the Washington State Board of Education. We are approved by the Washington State Board of Education.</p>');
