INSERT INTO `school_news` VALUES (1,'published',1,'2019-09-16 22:26:48','School Accreditation','2019-09-10','<p>Christ the King is an exemplary accredited school by WELSSA (Wisconsin Evangelical Lutheran Synod School Accreditation) and NCPSA (National Council for Private School Accreditation).</p><p>In October 2017, Christ the King had four site team members visiting our campus to conduct our accreditation self-study review (the culminating event of more than 7 years of work). The team visited classrooms, spoke with teachers, staff, parents, Board of Ed members, and students, and reviewed the evidence we provided for all 242 sub-standards in the accreditation self-study. During the final report, the site team identified commendations and recommendations in each of the 15 standards. CtK fully met 229 of the 242 sub-standards and an additional 10 standards as partially met. This gives us a 97% ranking and exemplary accreditation status!</p><p>Christ the King thanks the site visit team for taking time out of their busy lives to help us improve our ministry at CtK, our parents and students for their loving support; our faculty and staff for their dedication to teaching and caring for Godâ€™s little lambs; the Board of Ed for their guidance and support; and our congregation for staying committed to this process and the amazing support they give the school. To God be the Glory!</p><p>Click here to view the final report from the site visit team.</p>','1','school-accreditation',14),(2,'published',1,'2019-10-21 20:06:17','Some School News','2019-10-18','<p>Look at my news!<br></p>','1','some-school-news',12);
/*!40000 ALTER TABLE `school_news` ENABLE KEYS */;
UNLOCK TABLES;

