INSERT INTO `school_pages` VALUES (1,'published',NULL,1,'2019-09-16 21:29:09',1,'2019-09-19 17:33:43','Enrollment',NULL,'Enrollment at Christ the King',NULL,'<h5>Are you interested in enrolling your child at Christ the King? Following are the steps of our enrollment process.</h5><p>    What grade(s) are you interested in learning about? Please complete our CtK School Interest Form. Weâ€™ll contact you with information about the grade(s) you request.</p><p>    We would love to meet your family, answer any questions you have, and tell you about the quality, Christ-centered education we offer at Christ the King. Please call our school (360-692-8799) and set up at a time when you can come for a visit to receive information, take a tour of our school, and meet our principal and teachers.</p><p>    After you have read through all our school information, received answers to your questions, and have decided Christ the King is the school for your child, weâ€™ll provide you a link to set up an account on TADS. TADS is a company Christ the King uses to set up and manage tuition collection and financial aid.</p><p>    After you have completed and submitted your application, our principal will review your application. Approvals are typically processed in one to two business days.</p><p>    Once your application is approved, your family will move into the enrollment phase where you will complete some additional forms.</p><p>    If you need some help with your application, or you would like to submit a paper application, please contact our school office at 360-692-8799.</p><h2>Admissions</h2><p>Christ the King Lutheran Church and School exists to GLORIFY the triune God in worship, NURTURE our families through the study of Godâ€™s Word and Christian Education, and PROCLAIM the gospel of Jesus Christ to our community and the world. Our school is a wonderful blessing God has given us to share his gospel message with his little lambs.</p><h3>Returning Families</h3><p>Our returning families do not need to complete an application. TADS will send your system access information to the email address that Christ the King has on file. If you have any questions, please contact the school office.</p><h3>Financial Aid</h3><p>Providing quality Christian education is an integral part of the mission at Christ the King Lutheran Church. We strive to provide affordable solutions for families by subsidizing every childâ€™s education. Families may request additional aid through the financial aid application process. We understand that family circumstances change; therefore, we accept applications throughout the year.</p><h3>Tuition Discounts</h3><p>Tuition discounts are available to qualifying families. Multiple student credits are also available for families with additional children. Please inquire for more information.</p>',NULL,'1','enrollment');
/*!40000 ALTER TABLE `school_pages` ENABLE KEYS */;
UNLOCK TABLES;

